import type { Inventory, InvFile } from "./util.js";

/** Group duplicates by exact hash and by normalized hash. */
export function buildDuplicatesReport(inv: Inventory) {
  const map = new Map<string, string[]>();
  const norm = new Map<string, string[]>();
  for (const f of inv.files) {
    if (!map.has(f.sha256)) map.set(f.sha256, []);
    map.get(f.sha256)!.push(f.pathRel);

    if (!norm.has(f.sha256Normalized)) norm.set(f.sha256Normalized, []);
    norm.get(f.sha256Normalized)!.push(f.pathRel);
  }
  const groups = Array.from(map.entries())
    .map(([hash, paths]) => ({ hash, paths }))
    .filter((g) => g.paths.length > 1);
  const normalizedGroups = Array.from(norm.entries())
    .map(([hash, paths]) => ({ hash, paths }))
    .filter((g) => g.paths.length > 1);
  return { groups, normalizedGroups };
}

/** Detect relative ESM imports missing a .js-like extension. */
export function buildPolicyChecks(inv: Inventory) {
  const duplicatedNames = collectDuplicateNames(inv.files);

  const missingJsExtension: Array<{ file: string; line: number; spec: string }> = [];
  const relImportRegex1 = /import\s+[^'"]*from\s+['"]([^'"]+)['"]/g;  // import x from '...'
  const relImportRegex2 = /import\s+['"]([^'"]+)['"]/g;               // import '...'

  for (const f of inv.files) {
    if (!/\.tsx?$|\.jsx?$/.test(f.ext)) continue;
    if (!f.contentChunks) continue; // present only in --content runs

    for (const chunk of f.contentChunks) {
      const scan = (re: RegExp) => {
        re.lastIndex = 0;
        let m: RegExpExecArray | null;
        while ((m = re.exec(chunk.text))) {
          const spec = m[1];
          if (!spec.startsWith("./") && !spec.startsWith("../")) continue; // only relative
          if (spec.endsWith("/") || /(\.js|\.mjs|\.cjs|\.json|\.node)$/i.test(spec)) continue; // ok
          // TS path without extension → likely runtime break in NodeNext after build
          const line = chunk.startLine + (chunk.text.slice(0, m.index).match(/\n/g)?.length ?? 0);
          missingJsExtension.push({ file: f.pathRel, line, spec });
        }
      };
      scan(relImportRegex1);
      scan(relImportRegex2);
    }
  }

  return {
    duplicates: { sameName: duplicatedNames },
    imports: { missingJsExtension }
  };
}

function collectDuplicateNames(files: InvFile[]) {
  const sameName: Record<string, string[]> = {};
  for (const f of files) {
    const name = f.pathRel.split("/").pop()!;
    (sameName[name] ||= []).push(f.pathRel);
  }
  return Object.entries(sameName)
    .filter(([, paths]) => paths.length > 1)
    .map(([name, paths]) => ({ name, paths }));
}

import path from "node:path";
import type { Inventory } from "./util.js";

// dynamic import of TS to avoid loader quirks
let ts: typeof import("typescript");
async function getTS() {
  ts = ts ?? (await import("typescript"));
  return ts;
}

/** Build an import dependency graph using TypeScript's stable resolver. */
export async function buildDepsGraph(root: string, inv: Inventory) {
  const TS = await getTS();

  const tsconfigPath = TS.findConfigFile(root, TS.sys.fileExists, "tsconfig.json");
  if (!tsconfigPath) return { nodes: [], edges: [] };

  const configFile = TS.readConfigFile(tsconfigPath, TS.sys.readFile);
  const configParse = TS.parseJsonConfigFileContent(
    configFile.config,
    TS.sys,
    path.dirname(tsconfigPath)
  );

  const rootNames = inv.files
    .filter((f) => f.pathRel.endsWith(".ts") || f.pathRel.endsWith(".tsx"))
    .map((f) => f.pathAbs);

  const program = TS.createProgram({ rootNames, options: configParse.options });

  const nodes: string[] = [];
  const edges: Array<{ from: string; to: string }> = [];

  const host: import("typescript").ModuleResolutionHost = TS.sys;
  const compilerOptions = configParse.options;

  for (const sf of program.getSourceFiles()) {
    const file = sf.fileName;
    if (!file.startsWith(root) || file.includes("node_modules")) continue;

    nodes.push(file);

    sf.forEachChild((node) => {
      if (
        TS.isImportDeclaration(node) &&
        node.moduleSpecifier &&
        TS.isStringLiteral(node.moduleSpecifier)
      ) {
        const spec = node.moduleSpecifier.text;
        const resolved = TS.resolveModuleName(spec, file, compilerOptions, host).resolvedModule;
        if (resolved?.resolvedFileName && resolved.resolvedFileName.startsWith(root)) {
          edges.push({ from: file, to: resolved.resolvedFileName });
        }
      }
    });
  }

  // de-dupe
  const nodeSet = Array.from(new Set(nodes));
  const edgeSet = Array.from(new Set(edges.map((e) => `${e.from}=>${e.to}`))).map((k) => {
    const [from, to] = k.split("=>");
    return { from, to };
  });

  return { nodes: nodeSet, edges: edgeSet };
}

/** Find "dead" TS/TSX files: zero inbound edges and not in roots/ignored. */
export function findDeadFiles(
  deps: { nodes: string[]; edges: Array<{ from: string; to: string }> },
  roots: string[],
  ignore: RegExp[] = [/\.test\.tsx?$/i, /\.spec\.tsx?$/i]
) {
  const inbound = new Map<string, number>();
  for (const n of deps.nodes) inbound.set(n, 0);
  for (const e of deps.edges) inbound.set(e.to, (inbound.get(e.to) ?? 0) + 1);

  const rootSet = new Set(roots.map((r) => path.resolve(r)));

  const dead = [];
  for (const n of deps.nodes) {
    const ext = path.extname(n);
    if (!/\.tsx?$/i.test(ext)) continue;
    if (rootSet.has(path.resolve(n))) continue;
    if (ignore.some((re) => re.test(n))) continue;
    if ((inbound.get(n) ?? 0) === 0) dead.push(n);
  }
  return dead;
}

import { ESLint } from "eslint";

export async function runEslint(files: string[]) {
  // v9+ compatible: no deprecated constructor options
  const eslint = new ESLint({});

  // Only lint code files; fall back to a glob if list is empty
  const codeFiles = files.filter((f) => /\.[tj]sx?$/.test(f));
  const targets =
    codeFiles.length > 0
      ? codeFiles
      : ["**/*.{ts,tsx,js,jsx}", "!node_modules/**", "!dist/**"];

  const results = await eslint.lintFiles(targets);

  const summary = results.reduce(
    (acc, r) => {
      acc.errorCount += r.errorCount;
      acc.warningCount += r.warningCount;
      return acc;
    },
    { errorCount: 0, warningCount: 0 }
  );

  return {
    summary,
    results: results.map((r) => ({
      filePath: r.filePath,
      errorCount: r.errorCount,
      warningCount: r.warningCount,
      messages: r.messages.map((m) => ({
        ruleId: m.ruleId,
        severity: m.severity,
        message: m.message,
        line: m.line,
        column: m.column,
      })),
    })),
  };
}

import fs from "node:fs/promises";
import path from "node:path";
import os from "node:os";
import { inventoryRepo } from "./util.js";
import { buildDuplicatesReport, buildPolicyChecks } from "./checks.js";
import { buildDepsGraph, findDeadFiles } from "./deps.js";
import { runEslint } from "./eslint.js";
import { runTypecheck } from "./typecheck.js";

type CLIOpts = {
  root: string;
  includeContent: boolean;
  chunkLines: number;
  quick: boolean;
  excludes: string[];
};

function parseArgs(): CLIOpts {
  const args = process.argv.slice(2);
  const opts: CLIOpts = {
    root: process.cwd(),
    includeContent: args.includes("--content"),
    chunkLines: 300,
    quick: args.includes("--quick"),
    excludes: ["node_modules", "dist", ".git", ".turbo"]
  };
  const chunkIdx = args.indexOf("--chunks");
  if (chunkIdx >= 0 && args[chunkIdx + 1]) {
    const n = Number(args[chunkIdx + 1]);
    if (Number.isFinite(n) && n > 20 && n < 2000) opts.chunkLines = Math.floor(n);
  }
  const exclIdx = args.indexOf("--exclude");
  if (exclIdx >= 0 && args[exclIdx + 1]) {
    opts.excludes = args[exclIdx + 1].split(",").map((s) => s.trim()).filter(Boolean);
  }
  const rootIdx = args.indexOf("--root");
  if (rootIdx >= 0 && args[rootIdx + 1]) {
    opts.root = path.resolve(args[rootIdx + 1]);
  }
  return opts;
}

function nowStamp() {
  const d = new Date();
  const pad = (n: number) => String(n).padStart(2, "0");
  return `${d.getFullYear()}${pad(d.getMonth() + 1)}${pad(d.getDate())}-${pad(d.getHours())}${pad(d.getMinutes())}${pad(d.getSeconds())}`;
}

async function ensureDir(dir: string) {
  await fs.mkdir(dir, { recursive: true });
  return dir;
}

async function writeJSON(file: string, data: unknown) {
  await fs.writeFile(file, JSON.stringify(data, null, 2), "utf8");
}

async function writeMD(file: string, md: string) {
  await fs.writeFile(file, md, "utf8");
}

async function main() {
  const opts = parseArgs();
  const stamp = nowStamp();
  const outDir = path.join(opts.root, "data", "diagnostics", stamp);
  await ensureDir(outDir);

  // 1) Inventory
  const inv = await inventoryRepo({
    root: opts.root,
    excludes: opts.excludes,
    includeContent: opts.includeContent,
    chunkLines: opts.chunkLines
  });
  await writeJSON(path.join(outDir, "inventory.json"), inv);

  // 2) Duplicates + policy (missing .js ext)
  const dup = buildDuplicatesReport(inv);
  await writeJSON(path.join(outDir, "duplicates.json"), dup);

  const policy = buildPolicyChecks(inv);
  await writeJSON(path.join(outDir, "policy.json"), policy);

  // 3) Deps graph + dead files (skip in quick mode)
  let deps: any = { nodes: [], edges: [] };
  let dead: string[] = [];
  if (!opts.quick) {
    deps = await buildDepsGraph(opts.root, inv);
    await writeJSON(path.join(outDir, "deps.json"), deps);

    const entry = path.join(opts.root, "src", "index.ts");
    const roots = inv.files.some((f) => path.resolve(f.pathAbs) === path.resolve(entry))
      ? [entry]
      : [];
    dead = findDeadFiles(deps, roots);
    await writeJSON(path.join(outDir, "dead.json"), { roots, files: dead });
  }

  // 4) ESLint (skip quick)
  let lint: any = { summary: {}, results: [] };
  if (!opts.quick) {
    lint = await runEslint(inv.files.map((f) => f.pathAbs));
    await writeJSON(path.join(outDir, "eslint.json"), lint);
  }

  // 5) TypeScript type-check (skip quick)
  let tsc: any = { ok: true, errors: [] };
  if (!opts.quick) {
    tsc = await runTypecheck(opts.root);
    await writeJSON(path.join(outDir, "typecheck.json"), tsc);
  }

  // -------- Summary markdown (avoid backticks to keep esbuild happy) --------
  const extList = Object.entries(inv.byExt)
    .map(([k, v]) => `${k}(${v})`)
    .join(", ");

  const missingExtLines = (policy.imports?.missingJsExtension ?? [])
    .slice(0, 10)
    .map((i: any) => `  - ${i.file}:${i.line} -> '${i.spec}'`)
    .join("\n");

  const deadPreview = dead
    .slice(0, 10)
    .map((f) => `  - ${path.relative(opts.root, f).replace(/\\/g, "/")}`)
    .join("\n");

  const md = [
    `# Diagnostics Summary (${stamp})`,
    ``,
    `Root: ${opts.root}`,
    `Host: ${os.hostname()}`,
    `Include content: ${opts.includeContent} (chunkLines=${opts.chunkLines})`,
    ``,
    `## Inventory`,
    `- Files scanned: ${inv.files.length}`,
    `- Total size: ${(inv.totalBytes / 1024).toFixed(1)} KB`,
    `- File types: ${extList}`,
    ``,
    `## Duplicates`,
    `- Exact duplicates: ${dup.groups.length} groups`,
    `- Normalized duplicates: ${dup.normalizedGroups.length} groups`,
    ``,
    `## Policy checks`,
    `- Missing .js extension (relative ESM imports): ${policy.imports.missingJsExtension.length}`,
    missingExtLines,
    ``,
    `## Dependency graph`,
    `- Nodes: ${deps.nodes?.length ?? 0}, Edges: ${deps.edges?.length ?? 0}`,
    ``,
    `## Dead files`,
    `- Count: ${dead.length}`,
    deadPreview,
    ``,
    `## ESLint`,
    `- Errors: ${lint.summary?.errorCount ?? 0}, Warnings: ${lint.summary?.warningCount ?? 0}`,
    ``,
    `## TypeScript`,
    `- Typecheck OK: ${tsc.ok}`,
    `- Errors: ${tsc.errors?.length ?? 0}`,
    ``,
    `Detailed reports are in data/diagnostics/${stamp}/`,
    ``
  ].join("\n");
  await writeMD(path.join(outDir, "summary.md"), md);

  // 7) Pointer file
  await writeJSON(path.join(opts.root, "data", "diagnostics", "latest.json"), {
    stamp,
    outDir
  });

  console.log(`\n✅ Diagnostics complete → ${outDir}\n`);
}

main().catch((err) => {
  console.error("Diagnostics failed:", err);
  process.exitCode = 1;
});

import ts from "typescript";
import path from "node:path";

export async function runTypecheck(root: string) {
  const tsconfigPath = ts.findConfigFile(root, ts.sys.fileExists, "tsconfig.json");
  if (!tsconfigPath) return { ok: false, errors: [{ message: "tsconfig.json not found" }] };

  const configFile = ts.readConfigFile(tsconfigPath, ts.sys.readFile);
  const configParse = ts.parseJsonConfigFileContent(configFile.config, ts.sys, path.dirname(tsconfigPath));

  const program = ts.createProgram({
    rootNames: configParse.fileNames,
    options: { ...configParse.options, noEmit: true }
  });

  const diagnostics = ts.getPreEmitDiagnostics(program);
  const errors = diagnostics.map((d) => {
    const msg = ts.flattenDiagnosticMessageText(d.messageText, "\n");
    let file: string | undefined;
    let line: number | undefined;
    let col: number | undefined;
    if (d.file && d.start !== undefined) {
      const pos = d.file.getLineAndCharacterOfPosition(d.start);
      file = d.file.fileName;
      line = pos.line + 1;
      col = pos.character + 1;
    }
    return { file, line, col, message: msg, code: d.code, category: ts.DiagnosticCategory[d.category] };
  });

  return { ok: errors.length === 0, errors };
}

import fs from "node:fs/promises";
import path from "node:path";
import crypto from "node:crypto";

export type InvChunk = { startLine: number; text: string };

export type InvFile = {
  pathRel: string;
  pathAbs: string;
  size: number;
  mtimeMs: number;
  ext: string;
  sha256: string;
  sha256Normalized: string;
  lines: number;
  contentChunks?: InvChunk[]; // now includes startLine for precise findings
};

export type Inventory = {
  root: string;
  files: InvFile[];
  totalBytes: number;
  byExt: Record<string, number>;
};

export async function inventoryRepo(opts: {
  root: string;
  excludes: string[];
  includeContent: boolean;
  chunkLines: number;
}): Promise<Inventory> {
  const root = path.resolve(opts.root);
  const files: InvFile[] = [];

  async function walk(dir: string) {
    const entries = await fs.readdir(dir, { withFileTypes: true });
    for (const e of entries) {
      const full = path.join(dir, e.name);
      const rel = path.relative(root, full);
      if (opts.excludes.some((ex) => rel === ex || rel.startsWith(ex + path.sep))) continue;

      if (e.isDirectory()) {
        await walk(full);
      } else if (e.isFile()) {
        const ext = path.extname(e.name).toLowerCase();
        const stat = await fs.stat(full);

        // Try to read as text for code files; skip binary-ish
        const isBinary = [".png", ".jpg", ".jpeg", ".webp", ".gif", ".ico", ".woff", ".woff2"].includes(ext);
        const raw = isBinary ? null : await fs.readFile(full, "utf8").catch(() => null);

        const content = typeof raw === "string" ? raw : "";
        const normalized = normalizeCode(content);
        const sha256 = hash(content);
        const sha256Normalized = hash(normalized);
        const lines = content ? content.split(/\r?\n/).length : 0;

        const inv: InvFile = {
          pathRel: rel.replace(/\\/g, "/"),
          pathAbs: full,
          size: stat.size,
          mtimeMs: stat.mtimeMs,
          ext: ext || "noext",
          sha256,
          sha256Normalized,
          lines
        };

        if (opts.includeContent && content) {
          inv.contentChunks = chunkByLines(content, opts.chunkLines);
        }

        files.push(inv);
      }
    }
  }

  await walk(root);

  const byExt: Record<string, number> = {};
  for (const f of files) byExt[f.ext] = (byExt[f.ext] ?? 0) + 1;
  const totalBytes = files.reduce((a, f) => a + f.size, 0);

  return { root, files, totalBytes, byExt };
}

export function hash(s: string): string {
  return crypto.createHash("sha256").update(s).digest("hex");
}

/** Strip // and /* *\/ comments and whitespace for normalized comparison. */
export function normalizeCode(s: string): string {
  if (!s) return "";
  let out = s.replace(/\/\/.*$/gm, ""); // line comments
  out = out.replace(/\/\*[\s\S]*?\*\//g, ""); // block comments
  out = out.replace(/\s+/g, ""); // whitespace
  return out;
}

export function chunkByLines(s: string, chunkLines = 300): InvChunk[] {
  const lines = s.split(/\r?\n/);
  const chunks: InvChunk[] = [];
  for (let i = 0; i < lines.length; i += chunkLines) {
    chunks.push({ startLine: i + 1, text: lines.slice(i, i + chunkLines).join("\n") });
  }
  return chunks;
}

