async function main() {
  logger.info(
    { env: config.env, app: config.appName, logLevel: config.logLevel },
    "A`I project: booting…"
  );

  if (killSwitchActive()) {
    logger.warn("Global kill switch is ACTIVE — exiting cleanly.");
    return;
  }

  logger.info({ flags: listFlags() }, "Feature flags loaded");

  // --- Demo: audit + queue wiring ---
  const incident = await beginIncident({ note: "Tier-0 bootstrap" });

