type Job<T> = {
  run: () => Promise<T>;
  name?: string;
  resolve: (v: T) => void;
  reject: (e: unknown) => void;
};

export interface QueueOptions {
  concurrency?: number; // parallel workers
  rateLimit?: { max: number; intervalMs: number }; // X jobs per interval
}

export interface Queue {
  add<T>(fn: () => Promise<T>, name?: string): Promise<T>;
  size(): number;
  pending(): number;
  idle(): Promise<void>;
}

export function createQueue(opts: QueueOptions = {}): Queue {
  const concurrency = Math.max(1, opts.concurrency ?? 4);
  const rate = opts.rateLimit ?? { max: 20, intervalMs: 1000 };

  const q: Job<any>[] = [];
  let running = 0;

  // sliding window timestamps of "started" jobs
  const starts: number[] = [];

  let resolveIdle: (() => void) | null = null;
  const idlePromise = () =>
    new Promise<void>((res) => {
      if (running === 0 && q.length === 0) return res();
      resolveIdle = res;
    });

  function maybeResolveIdle() {
    if (running === 0 && q.length === 0 && resolveIdle) {
      const r = resolveIdle;
      resolveIdle = null;
      r();
    }
  }

  function haveToken(now: number): boolean {
    // drop old starts
    const cutoff = now - rate.intervalMs;
    while (starts.length && starts[0] < cutoff) starts.shift();
    return starts.length < rate.max;
  }

  function tryStart() {
    if (running >= concurrency) return;
    if (q.length === 0) return;

    const now = Date.now();
    if (!haveToken(now)) {
      // wait until next token becomes available
      const wait = Math.max(0, (starts[0] + rate.intervalMs) - now);
      setTimeout(tryStart, wait + 1);
      return;
    }

    const job = q.shift()!;
    running++;
    starts.push(now);

    job
      .run()
      .then((v) => job.resolve(v))
      .catch((e) => job.reject(e))
      .finally(() => {
        running--;
        maybeResolveIdle();
        // attempt to start more
        setImmediate(tryStart);
      });

    // fill remaining slots
    setImmediate(tryStart);
  }

  function add<T>(fn: () => Promise<T>, name?: string): Promise<T> {
    return new Promise<T>((resolve, reject) => {
      q.push({ run: fn, name, resolve, reject });
      tryStart();
    });
  }

  return {
    add,
    size: () => q.length,
    pending: () => running,
    idle: idlePromise
  };
}

import fs from "node:fs/promises";
import path from "node:path";
import logger from "./logger.js";
import config from "./config.js";
import { ensureDir } from "./fsx.js";
import { createId } from "./ids.js";

type Level = "trace" | "debug" | "info" | "warn" | "error" | "fatal";

export interface AuditInput {
  level?: Level;
  category: string; // e.g., "system", "guard", "incident", "demo"
  action: string;   // e.g., "start", "end", "ban_detected"
  actorId?: string;
  targetId?: string;
  guildId?: string;
  correlationId?: string;
  details?: Record<string, unknown>;
}

export interface AuditRecord extends Required<AuditInput> {
  id: string;
  ts: string; // ISO timestamp
}

/** Append an audit record to console and (optionally) JSONL file. */
export async function auditEvent(input: AuditInput): Promise<string> {
  const rec: AuditRecord = {
    id: createId("evt"),
    ts: new Date().toISOString(),
    level: input.level ?? "info",
    category: input.category,
    action: input.action,
    actorId: input.actorId ?? "",
    targetId: input.targetId ?? "",
    guildId: input.guildId ?? "",
    correlationId: input.correlationId ?? "",
    details: input.details ?? {}
  };

  // IMPORTANT: Call logger method directly so `this` stays bound.
  const level: Level = rec.level;
  const method = (logger as any)[level];
  if (typeof method === "function") {
    method.call(logger, { audit: true, ...rec }, `[audit] ${rec.category}.${rec.action}`);
  } else {
    logger.info({ audit: true, ...rec }, `[audit] ${rec.category}.${rec.action}`);
  }

  // File (JSONL) if enabled
  if (config.auditToFile) {
    const dir = await ensureDir(config.auditDir);
    const day = rec.ts.slice(0, 10); // YYYY-MM-DD
    const file = path.join(dir, `${day}.jsonl`);
    const line = JSON.stringify(rec) + "\n";
    await fs.appendFile(file, line, "utf8");
  }

  return rec.id;
}

/** Begin an incident (returns correlation id). */
export async function beginIncident(details?: Record<string, unknown>): Promise<string> {
  const incidentId = createId("inc");
  await auditEvent({
    level: "info",
    category: "incident",
    action: "start",
    correlationId: incidentId,
    details
  });
  return incidentId;
}

/** End an incident by correlation id. */
export async function endIncident(
  incidentId: string,
  details?: Record<string, unknown>
): Promise<void> {
  await auditEvent({
    level: "info",
    category: "incident",
    action: "end",
    correlationId: incidentId,
    details
  });
}

import "dotenv/config";
import { z } from "zod";

const EnvSchema = z.object({
  NODE_ENV: z.enum(["development", "test", "production"]).default("development"),
  APP_NAME: z.string().default("A`I Bot"),
  LOG_LEVEL: z.enum(["trace", "debug", "info", "warn", "error", "fatal"]).default("info"),
  KILL_SWITCH: z
    .string()
    .optional()
    .transform((v) => String(v ?? "false").toLowerCase() === "true"),
  FEATURE_FLAGS: z.string().default(""),
  AUDIT_TO_FILE: z
    .string()
    .optional()
    .transform((v) => String(v ?? "false").toLowerCase() === "true"),
  AUDIT_DIR: z.string().default("data/logs")
});

type Env = z.infer<typeof EnvSchema>;

export interface AppConfig {
  env: Env["NODE_ENV"];
  appName: string;
  logLevel: Env["LOG_LEVEL"];
  killSwitch: boolean;
  flags: Set<string>;
  auditToFile: boolean;
  auditDir: string;
}

function parseFlags(raw: string): Set<string> {
  return new Set(
    raw
      .split(",")
      .map((s) => s.trim())
      .filter(Boolean)
  );
}

const parsed = EnvSchema.parse(process.env);

const config: AppConfig = {
  env: parsed.NODE_ENV,
  appName: parsed.APP_NAME,
  logLevel: parsed.LOG_LEVEL,
  killSwitch: parsed.KILL_SWITCH!,
  flags: parseFlags(parsed.FEATURE_FLAGS),
  auditToFile: parsed.AUDIT_TO_FILE!,
  auditDir: parsed.AUDIT_DIR
};

export default config;

import config from "./config.js";

const runtimeFlags = new Set<string>();

export function isEnabled(flag: string): boolean {
  return config.flags.has(flag) || runtimeFlags.has(flag);
}

export function enable(flag: string): void {
  runtimeFlags.add(flag);
}

export function disable(flag: string): void {
  runtimeFlags.delete(flag);
}

export function listFlags(): string[] {
  return Array.from(new Set([...config.flags, ...runtimeFlags])).sort();
}

export function killSwitchActive(): boolean {
  return config.killSwitch === true;
}

import fs from "node:fs/promises";
import path from "node:path";

/** Ensure a directory exists (mkdir -p). Returns the absolute path. */
export async function ensureDir(dirPath: string): Promise<string> {
  const abs = path.isAbsolute(dirPath) ? dirPath : path.join(process.cwd(), dirPath);
  await fs.mkdir(abs, { recursive: true });
  return abs;
}

import crypto from "node:crypto";

/** Create a fast unique id; optional prefix for readability. */
export function createId(prefix?: string): string {
  const id = crypto.randomUUID();
  return prefix ? `${prefix}_${id}` : id;
}

import pino from "pino";

const isProd = process.env.NODE_ENV === "production";

const logger = pino({
  level: process.env.LOG_LEVEL || "info",
  ...(isProd
    ? {}
    : {
        transport: {
          target: "pino-pretty",
          options: {
            singleLine: true,
            colorize: true
          }
        }
      })
});

export default logger;
